db2 "SELECT
        current_timestamp                                                           ,
        varchar(memory_set_type, 20) as set_type                                    ,
        varchar(db_name, 20)         as dbname                                      ,
        (CAST(memory_set_used as decimal(28,3))     /CAST(1048576 as decimal(28,3))),
        (CAST(memory_set_used_hwm as decimal(28,3))/CAST(1048576 as decimal(28,3)))
FROM
        TABLE(MON_GET_MEMORY_SET('DATABASE', CURRENT_SERVER, -2))" ;
		
		
db2 
"select
        substr(APPL_ID,1,20)    as APPL_ID   ,
        substr(APPL_NAME,1,20)  as APPL_NAME ,
        substr(EVENT_TYPE,1,20) as EVENT_TYPE,
        EVENT_TIMESTAMP
from
        db2inst1.TAB_LOCKING
where
        DATE(EVENT_TIMESTAMP) = (current date - 3 days)
order by
        EVENT_TIMESTAMP desc" ;


